import React from 'react';

const ToggleButton = ({ isPublished, onClick }) => {
    return (
        <button onClick={onClick} className={isPublished ? 'published' : 'unpublished'}>
            {isPublished ? 'Unpublish' : 'Publish'}
        </button>
    );
};

export default ToggleButton;
